import React from "react";
import { Table } from "reactstrap";
import axios from "axios";
const master = (props) => {
  return (
    <div>
      <Table>
        <thead>
          <tr>
            <th>id</th>
            <th>성별</th>
            <th>년</th>
            <th>월</th>
            <th>일</th>
            <th>가입시간</th>
          </tr>
        </thead>

        <tbody>
          {props.data.map((contents, num) => (
            <>
              <tr>
                <td>{contents.id}</td>
                <td>{contents.gender}</td>
                <td>{contents.year}</td>
                <td>{contents.mon}</td>
                <td>{contents.day}</td>
                <td>{contents.time}</td>
                <td>{contents.subscriptionTime}</td>
              </tr>
            </>
          ))}
        </tbody>
      </Table>
    </div>
  );
};
master.getInitialProps = async function ({ query }) {
  //const url = require("url");
  //console.log(url);
  //  console.log(query.id);
  const res = await axios.get(
    "http://localhost:8001/7ZWc6ri466Gc6rSA66as7J6Q7Y6Y7J207KeA",
    {}
  );
  const data = await res.data;

  console.log(data);

  console.log(`Show data fetched. Count: ${data.length}`);
  return {
    data: data,
  };
};
export default master;
